import{Range}from"ace-builds";export class AceRangeUtil{static rangeToJson(n){return{start:{row:n.start.row,column:n.start.column},end:{row:n.end.row,column:n.end.column}}}static jsonToRange(n){return new Range(n.start.row,n.start.column,n.end.row,n.end.column)}static rangesToJson(n){return n.map((n=>AceRangeUtil.rangeToJson(n)))}static jsonToRanges(n){return n.map((n=>AceRangeUtil.jsonToRange(n)))}static toJson(n){return Array.isArray(n)?AceRangeUtil.rangesToJson(n):AceRangeUtil.rangeToJson(n)}static fromJson(n){return Array.isArray(n)?AceRangeUtil.jsonToRanges(n):AceRangeUtil.jsonToRange(n)}}